import { getPosition } from "../../services/users-api";

const UserList = ({users}) => {

    const positions = getPositions();

    return(
        <ul>
            {users && users.map(({id, email, name, phone, photo, position}) => (
                <li key={id}>
                    <img src={photo} alt="user-avatar" />
                    <h3>{name}</h3>
                    <h4>{email}</h4>
                    <p>{phone}</p>
                    <p>{position}</p>
                </li>
            ))}
        </ul>
    )
}

export default UserList;
